dna_seq = ""

licz_adenina = 0
licz_cytozyna = 0
licz_guanina = 0
licz_tymina = 0

for nukleotyd in dna_seq:
    if nukleotyd == "A":
        licz_adenina += 1
    elif nukleotyd == "C":
        licz_cytozyna += 1
    elif nukleotyd == "G":
        licz_guanina += 1
    elif nukleotyd == "T":
        licz_tymina += 1

print("Liczba adenin: ", licz_adenina)
print("Liczba cytozyn: ", licz_cytozyna)
print("Liczba guanin: ", licz_guanina)
print("Liczba tymin: ", licz_tymina)
